        const sadness_geometry = new THREE.BufferGeometry();
        sadness_geometry.setAttribute('position', new THREE.Float32BufferAttribute(sadness_vertices, 3));
        sadness_geometry.computeVertexNormals();

        const sadness_material = new THREE.MeshStandardMaterial({ color: 0x789cce });
        const sadness_mesh = new THREE.Mesh(sadness_geometry, sadness_material);
        //bed_mesh.rotation.x = -Math.PI/2;
        sadness_mesh.castShadow = true;
        scene.add(sadness_mesh);

        let moveSpeed = 0.1;


        // ✅ render loop
        function animate(t) {

            //sadness_mesh.rotation.y = t * 0.001;
            renderer.render(scene, camera);
            requestAnimationFrame(animate);
        }

        //ขยับต่อเนื่องเมื่อกดค้าง
        let keys = {};

        window.addEventListener('keydown', (e) => {
            keys[e.key.toLowerCase()] = true;
        });

        window.addEventListener('keyup', (e) => {
            keys[e.key.toLowerCase()] = false;
        });

        let velocityY = 0;
        const gravity = -0.01;
        const jumpStrength = 0.2;
        let isJumping = false;


        function animate() {
            requestAnimationFrame(animate);

            if (keys['a']) sadness_mesh.position.x -= moveSpeed;
            if (keys['d']) sadness_mesh.position.x += moveSpeed;
            if (keys['w']) sadness_mesh.position.z -= moveSpeed;
            if (keys['s']) sadness_mesh.position.z += moveSpeed;
            //if (keys['z']) sadness_mesh.position.y += moveSpeed;
            //if (keys['x']) sadness_mesh.position.y -= moveSpeed;
            if (keys['q']) sadness_mesh.rotation.y -= 0.1;
            if (keys['e']) sadness_mesh.rotation.y += 0.1;
            if (keys['r']) sadness_mesh.rotation.x -= 0.1;
            if (keys['t']) sadness_mesh.rotation.x += 0.1;
            if (keys['y']) sadness_mesh.rotation.z -= 0.1;
            if (keys['u']) sadness_mesh.rotation.z += 0.1;
            if (keys['i']) sadness_mesh.scale.set(1, 0.5, 0.5);
            if (keys['o']) sadness_mesh.scale.set(2, 1, 1);
            if (keys['p']) sadness_mesh.scale.set(3, 2, 2);

            // กระโดด
            velocityY += gravity;
            sadness_mesh.position.y += velocityY;

            // ตรวจสอบไม่ให้ทะลุพื้น (พื้นอยู่ที่ y = -0.4)
            if (sadness_mesh.position.y <= -0.4) {
                sadness_mesh.position.y = -0.4;
                velocityY = 0;
                isJumping = false;
            }


            renderer.render(scene, camera);
        }

        animate();
        animate(0);


        window.addEventListener('keydown', (event) => {
            switch (event.key.toLowerCase()) {
                case 'a':
                    sadness_mesh.position.x -= moveSpeed;
                    break;
                case 'd':
                    sadness_mesh.position.x += moveSpeed;
                    break;
                case 'w':
                    sadness_mesh.position.z -= moveSpeed;
                    break;
                case 's':
                    sadness_mesh.position.z += moveSpeed;
                    break;
                /*case 'z':
                    sadness_mesh.position.y += moveSpeed;
                    break;
                case 'x':
                    sadness_mesh.position.y -= moveSpeed;
                    break;*/
                case 'q':
                    sadness_mesh.rotation.y -= 0.1;
                    break;
                case 'e':
                    sadness_mesh.rotation.y += 0.1;
                    break;
                case 'r':
                    sadness_mesh.rotation.x -= 0.1;
                    break;
                case 't':
                    sadness_mesh.rotation.x += 0.1;
                    break;
                case 'y':
                    sadness_mesh.rotation.z -= 0.1;
                    break;
                case 'u':
                    sadness_mesh.rotation.z += 0.1;
                    break;
                case 'i':
                    sadness_mesh.scale.set(1, 0.5, 0.5);
                    break;
                case 'o':
                    sadness_mesh.scale.set(2, 1, 1);
                    break;
                case 'p':
                    sadness_mesh.scale.set(3, 2, 2);
                    break;
                case 'm':
                    sadness_mesh.material.color.set(Math.random() * 0xffffff);
                    break;


            }
            window.addEventListener('keydown', (event) => {
                const key = event.key.toLowerCase();

                if (key === ' ') { // กด spacebar เพื่อกระโดด
                    if (!isJumping) {
                        velocityY = jumpStrength;
                        isJumping = true;
                    }
                }


            });

        });
